import React from "react";
import "./Kontakt.css";

function Kontakt(props) {
  return (
    <div className="kontakt">
      <label>
        <input
          type="text"
          //   onChange={(e) => inputKupon(e.target.value)}
          placeholder="Ime i prezime*"
          required
        />
      </label>
      <label>
        <input
          type="email"
          //   onChange={(e) => inputKupon(e.target.value)}
          placeholder="Email*"
          required
        />
      </label>
      <label>
        <input
          type="text"
          //   onChange={(e) => inputKupon(e.target.value)}
          placeholder="Broj mobitela*"
          required
        />
      </label>
      <label>
        <input
          type="note"
          //   onChange={(e) => inputKupon(e.target.value)}
          placeholder="Napomena(opcionalno)"
        />
      </label>
      <div className="buttons">
          <Button onClick={props.setShow(true)}>Nazad</Button>
         { <Button >Dalje</Button>}
        </div>
    </div>
  );
}

export default Kontakt;
